3 DAYS IN LAKE COMO 💦🛶 

DAY 1:
BELLAGIO - tour Villa Melzi D'Eril and Parco di Villa Serbelloni, go shopping along the famous Via Giuseppe Garibaldi, have lunch at @hotelflorencebellagio (wisteria bloom here during Spring!) 

<< TIP: You can take 15 min ferry across the Lake for ~€3 >> 

DAY 2:
VARENNA - Tour Villa Monastero and Villa Cipressi, sip an Aperol Spritz with the ultimate view at @barilmolo_varenna , stroll along the idyllic Walk of Lovers, take a sunset boat tour along the lake with @lakecomo_boat 

DAY 3:
MENAGGIO - Tour Villa Mylius Vigoni and Waterfront Promenade, admire the famous Villa del Balbianello and Villa Carlotta 

